Lego Ninjago Arin'in Ninja Arazi Buggy Arabası 71811
7 yaş ve üzeri erkek ve kız çocuklar, LEGO® NINJAGO® Arin’in Arazi Buggy Arabası (71811) ile NINJAGO Ejderhaların Yükselişi televizyon dizisinin 2. sezonundan heyecan verici savaşları canlandırabilir. Çocuklar için bu macera setinde, hareketli tekerlekleri, süspansiyonu, 2 minifigürlük açılan kokpiti, atış yapacak 6 mermisi ve 2 mermi atıcısı ile kötüleri yakalamak için arkasında büyük bir kancası olan Arin’in sarı renginde bir araç bulunur. Ninja oyuncağı, bir Bebek Riyu modeli ve 4 NINJAGO minifigürüyle birlikte gelir: Tırmanma kancası ve katana kılıcı aksesuarlı Tırmanıcı Cole, tırmanma kancası ve katana kılıcı aksesuarlı Arin, pençeli Kurt Maskeli Pençe Savaşçısı ve kılıç aksesuarlı Cinder. LEGO NINJAGO inşa edilebilen ninja oyuncakları serisindeki robotlar, ejderhalar ve tapınaklarla hayranlar, kahramanları ile birlikte aksiyonu canlandırabilir (setler ayrı satılır). Ninja oyun setlerinin her biri, size ve çocuğunuza kolay ve sezgisel bir yapım macerasında yol gösteren LEGO Builder uygulamasıyla yapılabilir.;

Çocuklar için Arazi Buggy Arabası – 7 yaş ve üzeri erkek ve kız çocuklar, Arin’in ninja arazi aracı oyuncağıyla NINJAGO® Ejderhaların Yükselişi TV dizisinin 2. sezonundan savaşları canlandırabilir;
Özelliklerle dolu araç yapım seti – Arazi Buggy Arabası oyuncağının hareketli tekerlekleri, süspansiyonu, 2 minifigürlük açılan kokpiti, 2 mermi atıcısı ve 6 mermisi ve büyük bir kancası bulunur;
4 NINJAGO® karakteri – Bu macera arabası seti, Cinder ve Kurt Maskeli Pençe Savaşçısı ile savaşan Arin ve Tırmanıcı Cole minifigürleri ve bir bebek Riyu modeliyle birlikte gelir;
Silah aksesuarları – Tırmanıcı Cole ve Arin’in birer tırmanma kancasıyla katana kılıcı aksesuarı, Cinder’ın bir kılıç aksesuarı bulunur;
Ninja hediyesi – Bu macera oyuncağı, ninja aksiyon hikayelerini oynamayı seven 7 yaş ve üzeri erkek ve kız çocuklara eğlenceli bir yapım ve oyun deneyimi sunar ve doğum günü hediyesi fikridir;
Daha büyük ninja maceraları – Ejderhalar, robotlar ve araçlar içeren diğer NINJAGO® oyuncaklarına (setler ayrı satılır) göz atın;
Ninja oyuncakları evreni – LEGO® NINJAGO® setleri ejderhalar, araçlar ve tapınaklar içerir ve çocukların ninja kahramanlarıyla birlikte macera dolu hayali bir dünyaya kaçmalarına olanak tanır;
Ölçüler – 267 parçalı bu macera arabası setindeki araç modelinin yüksekliği 11 cm, uzunluğu 23 cm, genişliği 14 cm’dir;

